I do not know how miners may be causing these failures. There are many different criteria the validator uses, and each one can perhaps be failed in a different way. For example, the Summary task measures the similarity between a self-reported text completion and the prompt using Sentence Transformers. Now, the miner could self-report a very long completion and cause that line to run indefinitely or cause an error (requests.post to timeout). Thus, a tuple with two elements would be returned by the task's reward function, and the score will never be included.

The solution to this loophole is to simply append a score of 0 (along with appending the miner’s UID to temp_miner_UIDs) to the final two candidates' statements in this block.

